import { withStyles } from "@material-ui/styles";


const styles = {
  root: {
    height: "32px",
    padding: "0px 16px",
    background: "grey",

    boxSizing: "border-box",
    borderRadius:"16px",
    display:"flex",
    alignItems:"center",
    justifyContent:"center"
  }
}

function Chip(props) {
  const { classes } = props;
  return (
    <div className={classes.root}>
      <span>+ GMV</span>
    </div>
  )
}

export default withStyles(styles)(Chip);
